	(12, 'SV-2307-00012', 12, 9, 5, 'YGN 12 K-1234', 'YGN Kamayut', '2023-07-24 20:17:42', '2023-07-26 00:51:01', '2023-07-26', '2023-07-28 12:27:28', 600, '2023-07-24', '09:00', '2023-07-29', '22:30', './upload/SV-2307-00012/car-inspection-sheet.png', 1, 0, 0, 1, 1, 0, 0, 60, 'From Wikipedia, the free encyclopedia\n"Scientific data" redirects here. Not to be confused with Scientific Data (journal).\nFor data in computer science, see Data (computer science). For other uses, see Data (disambiguation) and Datum (disambiguation).\n\nThese are some of the different types of data.\nIn common usage and statistics, data (US: /ˈdætə/; UK: /ˈdeɪtə/) is a collection of discrete or continuous values that convey information, describing the quantity, quality, fact, statistics, other basic units of meaning, or simply sequences of symbols that may be further interpreted formally. A datum is an individual value in a collection of data. Data is usually organized into structures such as tables that provide additional context and meaning, and which may themselves be used as data in larger structures. Data may be used as variables in a computational process.[1][2] Data may represent abstract ideas or concrete measurements.[3] Data is commonly used in scientific research, economics, and in virtually every other form of human organizational activity. Examples of data sets include price indices (such as consumer price index), unemployment rates, literacy rates, and census data. In this context, data represents the raw facts and figures which can be used in such a manner in order to capture the useful information out of it.', 'From Wikipedia, the free encyclopedia\n"Scientific data" redirects here. Not to be confused with Scientific Data (journal).\nFor data in computer science, see Data (computer science). For other uses, see Data (disambiguation) and Datum (disambiguation).\n\nThese are some of the different types of data.\nIn common usage and statistics, data (US: /ˈdætə/; UK: /ˈdeɪtə/) is